import React from "react";
import './App.scss';
import HomeBanner from "./components/HomeBanner";
import Banner from "./components/Banner";
import List from "./components/List";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        {/* Adicionando rotas para diferentes componentes */}
        <Routes>
          <Route 
            path="/" 
            element={
              <>
                <HomeBanner /> {/* Exibe o banner principal */}
                <List title="Popular Movies" param="popular" /> {/* Exibe a lista de filmes populares */}
              </>
            } 
          />
          <Route 
            path="/banner" 
            element={<Banner />}

          />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
